import React from 'react'
import './Navbar.css'

const Navbar = () => {
    let imgURL = "https://pokeapi.co/static/pokeapi_256.888baca4.png"

    return (
        <div>
            <img
            src={imgURL}
            className="navbar-image"
            />
        </div>
    )
}

export default Navbar
